import React, {
  createContext,
  FC,
  useContext,
  useEffect,
  useState,
} from "react";
import { UsePaginate } from "../../services/base/paginate";
import { useResidentsList } from "../../services/resident/resident1.service";


import { Resident1 } from "../../services/resident/model";

export type ResidentContext = {
  list: UsePaginate<Resident1>;
};

const ResidentContext = createContext<ResidentContext | null>(null);

export const Resident1Provider: FC = ({ children }) => {
  const list = useResidentsList();

  return (
    <ResidentContext.Provider value={{ list }}>
      {children}
    </ResidentContext.Provider>
  );
};

export const useResidences1Context = () => {
  const context = useContext(ResidentContext);
  if (!context) {
    throw new Error("useResidences1context must be used inside Resident1Provider");
  }

  return context;
};

export default Resident1Provider;
